/****** Object:  StoredProcedure [dbo].[usp_Gps_Chip_CantidadPorOperador]    Script Date: 18/08/2019 21:35:09 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [dbo].[usp_Gps_Chip_CantidadPorOperador] 

AS
BEGIN
  SELECT
	c.operador,
	  count(c.operador)cantidad
	  

  FROM
	  CHIP AS c
	
  WHERE c.eliminado = 0
  GROUP BY c.operador
END
GO
/****** Object:  StoredProcedure [dbo].[usp_Gps_Chip_ListarChips]    Script Date: 18/08/2019 21:35:09 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [dbo].[usp_Gps_Chip_ListarChips]
	
AS
BEGIN
		SELECT
	c.idchip,
	c.operador,
	c.tipo_contrato,
	c.numero,
	c.estado,

	c.fecha,
	convert(varchar, c.fechacontrato, 23) as fechacontrato,
	DATEDIFF(mm, C.fechacontrato, GETDATE()) AS difereciafechacontratohoy
FROM
	CHIP AS c 
where 
	c.eliminado = 0
END
GO
